Set(
    varMainRecord,
    ThisItem
);
If(
    App.ActiveScreen = 'Encounter Step Screen' && varcurrentsession.'Session Type' = 'Session Type'.'Community Session',
    Clear(colCountEncounter);
    ClearCollect(
        colCountEncounter,
        varCurrentEncounter
    );
    ClearCollect(
        colCountRE,
        varcurrentRegEvent
    );
    Patch(
        colCountEncounter,
        varCurrentEncounter,
        {'Status Change Count': varCurrentEncounter.'Status Change Count' - 1}
    );
    If(
        First(colCountEncounter).'Status Change Count' = 0,
        Patch(
            colCountEncounter,
            LookUp(
                colCountEncounter,
                Encounter = varCurrentEncounter.Encounter
            ),
            {'Queue Status': [@'Queue Status'].Waiting}
        );
        Patch(
            colCountRE,
            varcurrentRegEvent,
            {'Queue Status': [@'Queue Status'].Waiting}
        )
    );
    Concurrent(
        Patch(
            'Registration Events',
            First(colCountRE),
            {'Queue Status': First(colCountRE).'Queue Status'}
        ),
        If(
            First(colCountEncounter).'Status Change Count' >= 0,
            Patch(
                Encounters,
                First(colCountEncounter),
                {
                    'Queue Status': First(colCountEncounter).'Queue Status',
                    'Status Change Count': First(colCountEncounter).'Status Change Count'
                }
            )
        )
    );
    
);
If(
    (App.ActiveScreen = 'Encounter Queue - School - Partially Digital Screen' And CountRows(colSelectedConsentSchoolPD) > 0) Or (App.ActiveScreen = 'Encounter Queue - Corporate - Partially Digital Screen' And CountRows(colSelectedCorpConsentsEQ) > 0),
    Set(
        varLoseSelectionWarning,
        true
    );
    Switch(
        varMainRecord.ID,
        0,
        Set(
            varNavigateTo,
            "0"
        ),
        4,
        Set(
            varNavigateTo,
            "4"
        ),
        5,
        Set(
            varNavigateTo,
            "5"
        ),
        6,
        Set(
            varNavigateTo,
            "6"
        ),
        7,
        Set(
            varNavigateTo,
            "7"
        )
    );
    Set(
        varMainRecord,
        LookUp(
            colNavigation,
            Name = "Encounter"
        )
    ),
    If(
        varMainRecord.ID = 5,
        Set(
            varShowCarerBtn,
            false
        )
    );
    If(
        varMainRecord.ID = 1,
        Switch(
            varcurrentsession.'Session Type',
            'Session Type'.'School Session',
            Navigate('Check In School Screen'),
            'Session Type'.'Community Session',
            Navigate('Check In Community Screen'),
            'Session Type'.'Corporate Session',
            Navigate('Check In Corporate Screen')
        ),
        varMainRecord.ID = 2,
        Switch(
            varcurrentsession.'Session Type',
            'Session Type'.'School Session',
            Navigate('Nurse School Screen'),
            'Session Type'.'Community Session',
            Navigate('Nurse Community Screen'),
            'Session Type'.'Corporate Session',
            Navigate('Nurse Corporate Screen')
        ),
        Navigate(ThisItem.Screen)
    );
    Set(
        varNewWalkIn,
        false
    )
);
